385430500 @venkiradkris  1) No minimum widgets for calculating maturity score
2) Score in team dashboard (called as gamification score) is not same as maturity score in product dashboard 
3) Maturity score is calculated basing on the metrics specified in this json. 
https://github.com/capitalone/Hygieia/blob/master/UI/src/test-data/cicd-gates.json

read through this block 

{
      "exhibitAs": "Code Coverage", // this is code quality widget 
      "source": {
        "api": "codeAnalysisData",
        "method": "staticDetails",
        "args": [{
          "name": "params",
          "value": {
            "max": 1,
            "componentId": "$componentid"
          }
        }],
        "result": {
          "location": "result.0.metrics",
          "rule": [{
            "==": [{
              "var": "name"
            }, "line_coverage"]
          }]
        }
      },
      "rules": {
        ">": [{
          "var": "value"
        }, 80]   // this value is code coverage percentage . if project code coverage is =>80, maturity score is added +1 . This value is configurable here.
      }
    } nireeshT
