384569291 solved it by adding the following at line: 95 (before decrypting) at DefaultGithubClient.java file:

```
try{
        settings.setPersonalAccessToken(Encryption.encryptString(settings.getPersonalAccessToken(),settings.getKey()));
       }catch(Exception e){
           LOG.info(e.getMessage());
       }
``` michaelreda
